import "./Title.css";
import mando from "../../src/assets/img/mando.png";

export default function Title({ title }) {
  return (
    <div className="title-block">
      <img
        className="logo"
        src={mando}
        alt="Mandalorian Helmet"
        width="30px"
        height="30px"
      />

      <h1 className="title">{title}</h1>
    </div>
  );
}
